import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: fetch('https://jsonplaceholder.typicode.com/users').then(response => {
        response.map(r => { return r })
      }),
    };
  }

  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster, pos) => (
          <h1 key={monster.id}>{monster.name}</h1>
        ))}
      </div>
    );
  }
}

export default App;
